import React from "react";
import { Link } from "react-router-dom";

const Error = () => {
  return (
    <div>
      <div className="name">ERRor</div>
      <Link to="/">
        <div className="asset-category">

          <button className="btn btn-primary btn-category">All</button>
        </div>
      </Link>
    </div>
  );
};

export default Error;
